import { Mail, User, Phone, Calendar, MessageSquare } from "lucide-react";
import { useState } from "react";

type FormData = {
  name: string;
  phone: string;
  email: string;
  service: string;
  content: string;
};

const ConsultationForm = () => {
  const [formData, setFormData] = useState<FormData>({
    name: "",
    phone: "",
    email: "",
    service: "insurance", // Giá trị mặc định
    content: "",
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log("Form submitted:", formData);
    // Xử lý submit form ở đây
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-bold text-center mb-6">Đăng ký tư vấn</h2>
      
      <form onSubmit={handleSubmit} className="space-y-4">
        {/* Tên */}
        <div className="space-y-1">
          <label htmlFor="name" className="flex items-center gap-2 text-sm font-medium">
            <User className="w-4 h-4" />
            <span>Tên</span>
          </label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            placeholder="Nhập tên của bạn"
            required
          />
        </div>

        {/* Số điện thoại */}
        <div className="space-y-1">
          <label htmlFor="phone" className="flex items-center gap-2 text-sm font-medium">
            <Phone className="w-4 h-4" />
            <span>Số điện thoại</span>
          </label>
          <input
            type="tel"
            id="phone"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            placeholder="Nhập số điện thoại"
            required
          />
        </div>

        {/* Email */}
        <div className="space-y-1">
          <label htmlFor="email" className="flex items-center gap-2 text-sm font-medium">
            <Mail className="w-4 h-4" />
            <span>Email</span>
          </label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            placeholder="Nhập email của bạn"
            required
          />
        </div>

        {/* Dịch vụ */}
        <div className="space-y-1">
          <label htmlFor="service" className="flex items-center gap-2 text-sm font-medium">
            <Calendar className="w-4 h-4" />
            <span>Chọn dịch vụ</span>
          </label>
          <select
            id="service"
            name="service"
            value={formData.service}
            onChange={handleChange}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          >
            <option value="insurance">Sản phẩm bảo hiểm</option>
            <option value="consulting">Tư vấn tài chính</option>
            <option value="investment">Đầu tư</option>
            <option value="other">Dịch vụ khác</option>
          </select>
        </div>

        {/* Nội dung */}
        <div className="space-y-1">
          <label htmlFor="content" className="flex items-center gap-2 text-sm font-medium">
            <MessageSquare className="w-4 h-4" />
            <span>Nội dung</span>
          </label>
          <textarea
            id="content"
            name="content"
            value={formData.content}
            onChange={handleChange}
            rows={3}
            className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            placeholder="Nhập nội dung tư vấn"
          />
        </div>

        {/* Nút gửi */}
        <button
          type="submit"
          className="w-full py-2 px-4 bg-blue-600 hover:bg-blue-700 text-white font-medium rounded-md transition duration-200"
        >
          Đăng ký tư vấn
        </button>
      </form>
    </div>
  );
};

export default ConsultationForm;
